description:
Join us in REVELATION 13 as we continue to read through the latter three and a half years of the Tribulation. Study the Biblical account of the Antichrist, given power by Satan, and the False Prophet. Recognize the nature of these three real characters, a false trinity, attempting to parallel the true and Holy Trinity. In these last days, we set our eyes on Jesus and walk boldly, purposefully, redeeming the time, according to His perfect will, His perfect plan.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
